import styled, { keyframes, css } from 'styled-components';

export const exitPoints = {
  topLeft: [-1000,-1000],
  bottomLeft: [1000,-1000],
  topRight: [-1000,1000],
  bottomRight: [1000,1000]
};


export const NotificationBox = styled.div`
  position: absolute;
  top: ${({top}) => top}px;
  left: ${({left}) => left}px;
  z-index: 1;
  cursor: pointer;
  user-select: none;
`;
